import React, { Component } from 'react';
import Navbar from './components/Navbar'
import Home from './components/Home'
import Table from './components/Table'
import Form from './components/Form'
import { BrowserRouter, Route} from 'react-router-dom'

class App extends Component {
  state = {
    tickets : [
      { id: 1, datecomplete: this.Today, month: 'November', week: '5', theme: 'Julia', ticketnumber: '370156', website: 'google.com', remarks: 'Edit Page', status: 'Complete', skill: 'Migration' }
    ]
  }

  Today = () => {
    let date = new Date().getDate(),
    month = new Date().getMonth() + 1,
    year = new Date().getFullYear();


    console.log(date + '/' + month + '/' + year);
  }

  render() {
    return (
      <BrowserRouter>
        <div className="chat-app">
          <Navbar />
          <Route exact path='/' render={()=> <Home tickets={this.state.tickets}/>}/>
          <Route path='/table' component={Table} />
          <Route path='/form' component={Form} />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
